import React from 'react'

import CourseSearch from './CourseSearch'
import CourseTopTitle from './CourseTopTitle'

function CourseTop() {
    return (
        
        <div class="courses-top">
            <CourseTopTitle />
            <CourseSearch />            
        </div>
        
    )
}

export default CourseTop
